            <div className='modalContainer'>
                <h3 className='modalTitle'>{name}</h3>
                <img alt="current category" src={require(``)}/>
                <p>{description}</p>
                <button type='button'>Close this modal</button>
            </div>
        </div>
    )
}

export default Modal;
